import { MDBContainer, MDBCard, MDBCardText, MDBBtn, MDBIcon } from 'mdb-react-ui-kit';
import React from 'react';

export default function Story() {
  return (
    <MDBContainer className='m-2 shadow-0'>
      <MDBCard  className='text-center shadow-0'>
        <MDBBtn className='rounded-circle'><MDBIcon fas icon="user-astronaut" /></MDBBtn>
        <MDBCardText className='text-nowrap'>
          Jon Smith
        </MDBCardText>
      </MDBCard>
    </MDBContainer>
  );
}
